function addChordD(b,a){addChord(b,"D",0,function(c){addMute(c,["LowE","A"]);addOpenString(c,"D");addFretPress(c,2,["G","HighE"]);addFretPress(c,3,"H")},a)}function addChordD_Fis(b,a){addChord(b,"D/F#",0,function(c){addMute(c,["A"]);addOpenString(c,"D");addFretPress(c,2,["LowE","G","HighE"]);addFretPress(c,3,"H")},a)}function addChordDsus2(b,a){addChord(b,"Dsus2",0,function(c){addMute(c,["LowE","A"]);addOpenString(c,["D","HighE"]);addFretPress(c,2,"G");addFretPress(c,3,["H"])},a)}function addChordDsus4(b,a){addChord(b,"Dsus4",0,function(c){addMute(c,["LowE","A"]);addOpenString(c,"D");addFretPress(c,2,"G");addFretPress(c,3,["H","HighE"])},a)}function addChordDm(b,a){addChord(b,"Dm",3,function(c){addMute(c,["LowE","A"]);addOpenString(c,"D");addFretPress(c,1,"HighE");addFretPress(c,2,"G");addFretPress(c,3,"H")},a)};